var tipuesearch = {"pages":[{"title":"About","text":"CMSimfly 內容管理網誌 課程倉儲: https://github.com/40923105/cd2022 內容管理: https://40923105.github.io/cd2022/ 課程投影片: https://40923105.github.io/cd2022/reveal 課程網誌: https://40923105.github.io/cd2022/blog","tags":"misc","url":"./pages/about/"},{"title":"cd2022 w6","text":"cd2022 w6 w2 1.建立倉儲 2.用出分組名單 w3 分配 NX 教學影片 Wink 製作 40923107 1-6 40923105 7-12 40923110 13-18 40923106 19-24 40923102 25-30 40923104 31-36","tags":"Misc","url":"./w6_40923105.html.html"},{"title":"cd2022 w7","text":"cd2022 w7 以隨身程式系統編譯此程式碼 : 1.git clone https://github.com/mdecourse/scarysim.git 2.修改 scarysim.pro, 蓋掉第 11 行, 成為 # LIBS += -lglut -lGLU 3.cd scarysim 4.qmake -o Makefile scarysim.pro 5.mingw32-make -f Makefile.Release 可以在 release 目錄取得 scarysim.exe scarysim.exe 執行需要 base.obj, arm1.obj, arm2.obj, arm3.obj 等零件外型檔案, 及對應的 .mtl 材質檔案, 因此將 scarysim.exe 移至倉儲目錄, 並需要 msys64_20210419\\mingw64\\bin 路徑中的 dll 動態連結程式庫配合執行. 由於此套程式碼在 Target 模式下, 零組件間會造成干涉, 表示其 Inverse Kinematic 運算並不正確, 請設法修正此錯誤後, 修改其零件尺寸與操作控制方法, 設法模擬 MTB 的 Pick and Place demo 範例 7.各組組員分別利用 Solvespace、NX12、NX1980、NX2008 與 Onshape 繪製 Pick and Place demo 的零組件, 並完成 Coppeliasim 4.1.0、4.2.0 與 4.3.0 版的 MTB 機械手臂 Pick and Place 模擬","tags":"Misc","url":"./w7_summary.html"},{"title":"cd2022 w8","text":"cd2022 w8 分配繪圖 Solvespace, NX (12, 1980 或 2008) 及 Onshape : 4、6 : Onshape； 2、10 : NX； 5、7 : Solvespace 查驗項目 : 1.uarm 各零件工程圖 2.uarm 組合圖 3.uarm 組合圖 STL 格式轉入 CoppeliaSim 4.GUI slider 控制前三軸作動 5.cmsimde 中第一階頁面, 標題為 midterm 6.網誌名稱為 midterm.html 7.流程與心得簡報","tags":"Misc","url":"./w8.html"},{"title":"cd2022 w9","text":"cd2022 w9 期中自評","tags":"Misc","url":"./w9.html"}]};